import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav } from 'react-bootstrap';
import './navbar.css'; // Importar la hoja de estilos CSS

// Here I define de navbar component

function CustomNavbar() {
    return (
        <nav>
            <ul>
                <li className="nav-item">
                    <Link to="/" className="nav-link">Home</Link>
                </li>
                <li className="nav-item">
                    <Link to="/about" className="nav-link">About</Link>
                </li>
                <li className="nav-item">
                    <Link to="/contact" className="nav-link">Contact</Link>
                </li>
            </ul>

            <div className="nav-icons">
                <a href="https://github.com/tu-cuenta-de-github" target="_blank" rel="noopener noreferrer" className="nav-link">
                    <FaGithub />
                </a>
                <a href="mailto:tu-correo-electronico" className="nav-link">
                    <MdEmail />
                </a>
                {/* Agrega otros iconos y enlaces seg√∫n tus necesidades */}
            </div>
        </nav>
    );
}

export default CustomNavbar;
